DROP TABLE IF EXISTS `conference_publications`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `conference_publications` (
  `id` int NOT NULL AUTO_INCREMENT,
  `Academic_Year` varchar(255) NOT NULL,
  `Name_Of_The_Teacher` varchar(512) NOT NULL,
  `Branch` varchar(255) NOT NULL,
  `Title_Of_The_Paper` varchar(512) NOT NULL,
  `Title_Of_The_Proceedings` varchar(512) NOT NULL,
  `Name_Of_The_Conference` varchar(512) NOT NULL,
  `National_Or_International` varchar(512) NOT NULL,
  `Year_Of_Publication` varchar(255) NOT NULL,
  `ISBN_Or_ISSN_Number` varchar(512) NOT NULL,
  `Affiliating_Institute` varchar(512) NOT NULL,
  `Name_Of_Publisher` varchar(512) NOT NULL,
  `Details_Of_Paper` varchar(512) NOT NULL,
  `Indexing` varchar(255) NOT NULL,
  `other` varchar(255) NOT NULL,
  `Paper_Weblink` varchar(512) NOT NULL,
  `pdffile2` text NOT NULL,
  `pdffile3` text NOT NULL,
  `user_id` int NOT NULL,
  `STATUS` varchar(50) NOT NULL,
  `publication_date` date DEFAULT NULL,
  `is_full_date_known` tinyint(1) DEFAULT '0',
  `faculty_id` bigint DEFAULT NULL,
  `abstract` text,
  `citation_count` int DEFAULT '0',
  `doi` varchar(255) DEFAULT NULL,
  `publication_venue` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `fk_faculty` (`faculty_id`),
  CONSTRAINT `fk_faculty` FOREIGN KEY (`faculty_id`) REFERENCES `faculty` (`F_id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

