--
-- Table structure for table `journal_publications`
--

DROP TABLE IF EXISTS `journal_publications`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `journal_publications` (
  `id` int NOT NULL AUTO_INCREMENT,
  `Academic_year` varchar(255) NOT NULL,
  `Name_Of_Faculty` varchar(255) NOT NULL,
  `Branch` varchar(50) NOT NULL,
  `Title_Of_Paper` varchar(512) NOT NULL,
  `Name_Of_Author` varchar(512) NOT NULL,
  `Name_Of_Journal` varchar(500) NOT NULL,
  `Year_Of_Publication` varchar(255) NOT NULL,
  `ISSN_ISBN` varchar(255) NOT NULL,
  `Link_Of_Paper` varchar(512) NOT NULL,
  `Indexing` varchar(255) NOT NULL,
  `other` varchar(255) NOT NULL,
  `Details_Of_Paper` varchar(512) NOT NULL,
  `Paper_Weblink` varchar(512) NOT NULL,
  `Journal_Paper` varchar(512) NOT NULL,
  `user_id` int NOT NULL,
  `STATUS` varchar(50) NOT NULL,
  `faculty_id` bigint DEFAULT NULL,
  `abstract` text,
  `citation_count` int DEFAULT '0',
  `doi` varchar(255) DEFAULT NULL,
  `publication_venue` varchar(255) DEFAULT NULL,
  `publication_date` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_faculty_journal` (`faculty_id`),
